import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class Card extends Component{
    render(){
        return(
          <table class='table'>
              <tr>
                  <td>1</td>
                  <td>2</td>
              </tr>
          </table>
        )
    }
}

export default Card
